import React, {useState} from 'react';
import '../css/CadetsPage.css'

const GroupPage = () => {
    const [cadets, setCadets] = useState([])
    const {id} = useParams()
    return (
        <div>
            <div className={"cadet-page-container"}>
                <div className={"cadet-page-title"}>Список курсантів</div>
                <div className={"cadet-page-table"}>
                    <div className={"cadet-page-table-l1"}>
                        <div>№</div>
                        <div>Прізвище</div>
                        <div>Ім'я</div>
                        <div>По-батькові</div>
                        <div>Звання</div>
                    </div>
                    {cadets.map((с, index) => (
                        <div className={"cadet-page-table-l2"} key={с.id}>
                            <div>{index}</div>
                            <div>{с.surname}</div>
                            <div>{с.name}</div>
                            <div>{с.lastname}</div>
                            <div>{с.rank}</div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default GroupPage;
